export function editDeliverymanRequest(id) {
  return {
    type: '@deliverman/EDIT_REQUEST',
    payload: { id },
  };
}

export function editDeliverymanSuccess(profile) {
  return {
    type: '@deliverman/EDIT_SUCCESS',
    payload: { profile },
  };
}

export function editFailure() {
  return {
    type: '@deliverman/EDIT_FAILURE',
  };
}
